void convertTo16Bit(uint8_t image[], uint16_t imageNew[]) {
   for (int i = 0; i < 320 * 240 * 2; i++) {
       imageNew[i/2] = (image[i] << 8) | image[i+1]; //concatenate two 8 bits entries for RGB565 
    }
}

void clear_screen(void) {
  for (int x = 0; x < 320; x++) {
    for (int y = 0; y < 240; y++) {
      plot_pixel(x, y, 0);
    }
  }
}

void plot_pixel(int x, int y, short int line_color) {
  *(volatile short int*)(pixel_buffer_start + (y << 10) + (x << 1)) =
      line_color;
}
